import React from "react";

const Footerbox = (props) => {
    return (
        <div className="col-md-4 col-lg-4">
            <h4>{props.title}</h4>
            <ul>
                <li>
                    <a href={`${props.path_one}`}>{props.link_one}</a>
                </li>
                <li>
                    <a href={`${props.path_two}`}>{props.link_two}</a>
                </li>
                <li>
                    <a href={`${props.path_three}`}>{props.link_three}</a>
                </li>
                <li>
                    <a href={`${props.path_four}`}>{props.link_four}</a>
                </li>
            </ul>
        </div>
    );
};

export default Footerbox;
